/* eslint-disable jsx-a11y/anchor-has-content */
import React from 'react';
import './Projects.css'
import { ProjectItems } from './ProjectItems';
import photosite from './assets/img/visualsbydandre.jpg';

export default function Projects() {
    return (
        <div id="projects">
            <h2 className="section-title">Projects</h2>
            <div className="project-container">
                <h2>{ProjectItems[0].name}</h2>
                <img src={photosite} alt="photography portfolio" />     
                <p>{ProjectItems[0].description}</p>
                <span>Tools: {ProjectItems[0].tools}</span>
                <div className="web-link">
                    <button className="btn"><a href={ProjectItems[0].link}><b>Visit Website</b></a></button>
                </div>
            </div>
            <p>
                My other coding projects can be found on my github.
            </p>
        </div>
    );
};
